import React from 'react';
import Moment from 'moment';
import { DateInput } from './components/DateInput';
import { Favorites } from './components/Favorites';
import { Launches } from './components/Launches';
import './App.scss';

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      startDate: "1979-09-19",
      endDate: "2019-09-19",
    }
  }
  /*
const queryString = ("start=" + this.props.start + "&end=" + this.props.end);
        console.log('https://api.spacexdata.com/v3/launches/past?' + queryString);
        Axios.get('https://api.spacexdata.com/v3/launches/past?' + queryString)
            .then((response) => {
                this.setState({
                    launches: response.data.map((launch, index) => {
                        //console.log("payloadful");
                        //console.log(launch.rocket.second_stage.payloads);
                        return <Launch
                            key={"Launch" + index}
                            links={launch.links}
                            title={launch.mission_name}
                            date={launch.launch_date_utc}
                            desc={launch.details}
                            payloads={launch.rocket.second_stage.payloads}
                        />;

                    })
                });
                //console.log(this.state.launches);
            }).catch((response) => {
                console.log("error " + response);
            });
  */
  dateCallBack = (start, end) => {
    if (start < end) {
      this.setState({
        startDate: start,
        endDate: end,
      });
    }
    console.log(start, end);
    console.log(this.state);
  }
  componentDidUpdate() {
    console.log("update");
    console.log(this.state);
  }
  render = () => {
    const launches = <Launches start={this.state.startDate} end={this.state.endDate} />
    return (
      <div className="app">
        <h1>Launches</h1>
        <DateInput callBack={this.dateCallBack} />
        {"SpaceX launches from " + this.state.startDate + " to " + this.state.endDate}
        <Favorites favorites={[]} />
        {launches}
      </div>
    );
  }
}

export default App;
